import { ToastContainer, toast } from 'react-toastify';


function App() {

  const btnHandle = ()=>
  {
    toast.done("Kya Re Bhik Mangyaaa")
  }

  return (
    <div>
     <ToastContainer/>
     <h1>Hello Atul</h1>
      <Button color="primary"  onClick={btnHandle}>Click Here</Button>
    </div>
  );
}

export default App;
